      <p>Looking to create a page for a business? Get help</p>
      <p>
        <Logf style = {{align:"bottom"}}/> Â© 2021 About Accessibility User Agreement Privacy Policy
        Cookie Policy Copyright Policy Brand Policy Guest Controls Community
        Guidelines
      </p>
    </>
  );
};
export default Footer;
